import React from 'react'
import s from './Footer.module.css'
import { useNavigate } from 'react-router-dom';

const Footer1 = (props) => {
    let link = ''
    //let link = (hist['*'] === 'Sponsors/Yandex' || 
    //hist['*'] === 'Sponsors/QulixSystems')
    const navigte = useNavigate();


    return (
        <div className={s.Footer}>
            <a className={s.Button1} h><span className={s.lable}>Сайт компании</span></a>
            <div className={s.Button2} onClick={() => navigte(link)}><span className={s.lable}>Информация о направлении</span></div>
        </div>
    );
}


export default Footer1;
